import React from 'react';
import './feature'

const Feature = ({name, img}) => {
    return (
        <div className='gtp3__features__techno-container__feature'>
            <div className='gtp3__features__techno-img'>
                <img src={img} alt="" />
            </div>
            <div className='gtp3__features__techno_name'>
                <p>{name}</p>
            </div>
        </div>
    );
};

export default Feature;
